import { StatusBar } from "expo-status-bar";
import React from "react";
import {
  StyleSheet,
  Text,
  View,
  Alert,
  FlatList,
  ImageBackground,
  Image,
  Dimensions,
  TouchableHighlight,
  AsyncStorage,
  ScrollView
} from "react-native";

import SessionNavbar from "./security/SessionNavbar";
import Home from "../screens/Main";


export default class Main extends React.Component {
    constructor(props) {
        super(props);
      }
    
      state = {
        isLoggedIn: false
      };
    
      async componentDidMount() {
        let session = await AsyncStorage.getItem("session");
    
        if (session) {
          
          console.log(session)
          this.setState({
            
            isLoggedIn: true,
          });
        }
      }
  
  render() {
    const { navigation } = this.props;
    if(this.state.isLoggedIn === false){
        return(
        
            <ScrollView  style={{backgroundColor:"white"}}>
            <SessionNavbar navigation={navigation}></SessionNavbar>
            <Text style={styles.texto}>¿Por qué Matching?</Text>
            <Text style={styles.texto}>¿Cómo funciona Matching?</Text>
            <Text style={styles.texto}>Testimonios</Text>
            </ScrollView>
          );
    }else{
        return <Home navigation={navigation}></Home>
    }
   
}
}

const styles = StyleSheet.create({
  homeeses:{
    alignItems: "center",
    justifyContent: "center",
  },

  imagenHome: {
    height:500,
    width: "100%",
    marginTop:30,
    paddingEnd:30
  },

  texto:{
    fontWeight: "800",
    fontSize: 30,
    color: "#2962FF",
    alignItems: "center",
    justifyContent: "center",
    marginStart:50
  }
});
